package cn.com.evo.integration.scyd.pay.dto;/** * @Description: 鉴权响应实体 * @author: lu.xin * @create: 2019-03-29 10:56 AM **/public class ScydResponseDto {    private String result;    private String message;    private String detailMessage;    private String cloudPayUrl;    public String getResult() {        return result;    }    public void setResult(String result) {        this.result = result;    }    public String getMessage() {        return message;    }    public void setMessage(String message) {        this.message = message;    }    public String getDetailMessage() {        return detailMessage;    }    public void setDetailMessage(String detailMessage) {        this.detailMessage = detailMessage;    }    public String getCloudPayUrl() {        return cloudPayUrl;    }    public void setCloudPayUrl(String cloudPayUrl) {        this.cloudPayUrl = cloudPayUrl;    }    @Override    public String toString() {        return "ScydResponseDto{" +                "result='" + result + '\'' +                ", message='" + message + '\'' +                ", detailMessage='" + detailMessage + '\'' +                ", cloudPayUrl='" + cloudPayUrl + '\'' +                '}';    }}